export const SET_MENU_OPEN = 'SET_MENU_OPEN';
export const SET_ACTIVE_SECTION = 'SET_ACTIVE_SECTION';
export const SET_XP_OPEN = 'SET_XP_OPEN';
export const SET_LAYERS_OPEN = 'SET_LAYERS_OPEN';
export const SET_SHOW_EDUCATION = 'SET_SHOW_EDUCATION';
export const SET_SHOW_RESIDENCE = 'SET_SHOW_RESIDENCE';
export const SET_SHOW_WORK = 'SET_SHOW_WORK';

export const setMenuOpen = (data) => ({ type: SET_MENU_OPEN, data });
export const setActiveSection = (data) => ({ type: SET_ACTIVE_SECTION, data });
export const setXpOpen = (data) => ({ type: SET_XP_OPEN, data });
export const setLayersOpen = (data) => ({ type: SET_LAYERS_OPEN, data });
export const setShowEducation = (data) => ({ type: SET_SHOW_EDUCATION, data });
export const setShowResidence = (data) => ({ type: SET_SHOW_RESIDENCE, data });
export const setShowWork = (data) => ({ type: SET_SHOW_WORK, data });
